        <>

        <div className = 'card'>
            <div className='card-side card-side-front'>

            <div className='card-img' style={{backgroundImage: `url(${imgUrl})`
      }}
    />

                    <h3 className ='card-name'>{title}</h3>
                    <p className ='card-body-description'>{description}</p>

            </div>
