                <div className="card-footer-social">
                    <h3>{gitUrl}</h3>
                    <p>GitHub</p>
                </div>
                <div className="card-footer-social">
                    <h3>{linkUrl}Live Demo</h3>
                    <p>Live Demo</p>
                </div>


            </div>

        </div>


        </>


);

export default withRouter(Project);
